import React, { useEffect } from 'react';
import './styles/globals.css';
import './styles/tree.css';
import './BST/js_binary_search_tree.css';
import './AVL/js_avl_tree.css';
import AVLTree from './AVL/js_avl_tree';
import AVLTreeUI from './AVL/avl_tree_ui';
import createSampleTreeData from './BST/create-sample-tree-data';


const AVL = () => {
  useEffect(() => {
    const main = () => {
      const avlTree = sampleData();
      const avlUI = new AVLTreeUI(avlTree);
      avlUI.init();
      avlUI.render();
      window.avlTree = avlTree;
    };

    main();
  }, []);

  const sampleData = () => {
    const tree = new AVLTree();
    createSampleTreeData(tree);
    return tree;
  };

  const leftHeavyTree = () => {
    // LL Imbalance
    const tree = new AVLTree();
    tree.insert(30);
    tree.insert(20);
    // tree.insert(10);
    return tree;
  };

  const rightHeavyTree = () => {
    // RR Imbalance
    const tree = new AVLTree();
    tree.insert(30);
    tree.insert(40);
    // tree.insert(50);
    return tree;
  };

  const leftRightHeavyTree = () => {
    // LR Imbalance
    const tree = new AVLTree();
    tree.insert(30);
    tree.insert(10);
    // tree.insert(20);
    return tree;
  };



  return (
    <div>
    </div>
  );
};

export default AVL;
